CREATE TABLE IF NOT EXISTS `mapa_catalogo_exportacion` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pais` varchar(100) DEFAULT NULL,
  `puerto` varchar(100) DEFAULT NULL,
  `pto_destino` varchar(100) DEFAULT NULL,
  `tarifa` varchar(50) DEFAULT NULL,
  `salidas` varchar(50) DEFAULT NULL,
  `minimo` varchar(50) DEFAULT NULL,
  `tt` varchar(10) DEFAULT NULL,
  `via` varchar(50) DEFAULT NULL,
  `region` varchar(300) DEFAULT NULL,
  `city` varchar(300) DEFAULT NULL,
  `city_ascii` varchar(300) DEFAULT NULL,
  `lat` decimal(14,8) DEFAULT NULL,
  `lng` decimal(14,8) DEFAULT NULL,
  `pop` int(11) DEFAULT NULL,
  `country` varchar(300) DEFAULT NULL,
  `iso2` varchar(300) DEFAULT NULL,
  `iso3` varchar(300) DEFAULT NULL,
  `province` varchar(300) DEFAULT NULL,

  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=220 ;

